const Navbar = ()=>{
    return (
        <nav className="navbar">
            <div className="logo-navbar">
                <img src="./images/HeaderFigmaImg/Logo.svg"/>
                <img src="./images/HeaderFigmaImg/Hire Me.svg"/>
            </div>
            <ul className="btns-navbar">
                <li>PORTFOLIO</li>
                <li>BLOG</li>
                <li>CV</li>
                <li>STORE</li>
                <li>FREELANCE</li>
                <li>ABOUT ME</li>
                <li>CONTACT</li>
            </ul>
        </nav>
    );
}
export default Navbar;
